import React from "react";
import { Row, Col, Form, Input, InputNumber } from "antd";

const CustomizedForm = ({
  form,
  data,
  firstData,
  secondData,
  thirdData,
  fourthData
}) => (
  <Form
    form={form}
    layout="vertical"
    name="form_in_modal"
    initialValues={{
      name: data.name,
      price: data.price,
      type: data.type,
      date: data.date
    }}
  >
    <Row>
      <Form.Item
        name={firstData}
        label={firstData}
        rules={[
          {
            required: true,
            message: `Please input the ${firstData}!`
          }
        ]}
      >
        <Input />
      </Form.Item>
    </Row>
    <Form.Item
      name={secondData}
      label={secondData}
      rules={[
        {
          required: true,
          message: `Please input the ${secondData}!`
        }
      ]}
    >
      <InputNumber
        min={0}
        step={0.1}
        formatter={secondData => `¥ ${secondData}`}
      />
    </Form.Item>
    <Form.Item
      name={thirdData}
      label={thirdData}
      rules={[
        {
          required: true,
          message: `Please input the ${thirdData}!`
        }
      ]}
    >
      <Input />
    </Form.Item>
    <Form.Item
      name={fourthData}
      label={fourthData}
      rules={[
        {
          required: true,
          message: `Please input the ${fourthData}!`
        }
      ]}
    >
      <Input />
    </Form.Item>
  </Form>
);
export default CustomizedForm;
